import React from "react";
import img from "./img/loan2.jpg";
import img1 from "./img/loan1.jpg";
import img2 from "./img/loan3.jpg";

const Crousel = () => {
  return (
    <div>
      <div
        id="carouselExampleSlidesOnly"
        className="carousel slide"
        data-bs-ride="carousel"
      >
        <div className="carousel-inner">
          <div className="carousel-item  active" data-bs-interval="2000">
            <img src={img} className="d-block  mx-auto img-fluid" alt="..." />
          </div>
          <div className="carousel-item " data-bs-interval="2000">
            <img src={img1} className="d-block  mx-auto img-fluid" alt="..." />
          </div>
          <div className="carousel-item " data-bs-interval="2000">
            <img src={img2} className="d-block  mx-auto img-fluid" alt="..." />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Crousel;
